    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}To-do List{% endblock %}

{% block body %}
    {% for message in app.flashes('success') %}
        <div class=\"alert alert-success\">
            {{ message }}
        </div>
    {% endfor %}
    {% if articles %}
        <table id=\"articles\" class=\"table table-striped\">
            <thead>
            <tr>
                <th>ID</th>
                <th>Task Title</th>
                <th>Description</th>
                <th>Actions</th>
            </tr>
            </thead>
            <tbody>
            {% for article in articles %}
                <tr>
                    <td>{{ article.id }}</td>
                    <td>{{ article.title }}</td>
                    <td>{{ article.des }}</td>
                    <td>
                        <a href=\"/article/{{ article.id }}\" class=\"btn btn-dark\">Show</a>
                        <a href=\"/article/edit/{{ article.id }}\" class=\"btn btn-light\">Edit</a>
                        <a href=\"/delete/{{ article.id }}\" class=\"btn btn-danger delete-article\">Delete</a>
                    </td>
                </tr>
            {% endfor %}
            </tbody>
        </table>
    {% else %}
        <p>No Todo Tasks to display</p>
    {% endif %}
{% endblock %}

{% block javascripts %}
    <script src=\"/js/main.js\"></script>
{% endblock %}", "articles/index.html.twig", "/home/quan/symfony-todo/templates/articles/index.html.twig");
